content:
&#x27;후궁이 됐으니 그다음은 황후&#x27;
&#x27;대학 갔으면 그다음은 취직&#x27;
이세계도 별거 없구나...

모야..폐하 ..  
내가 왜 설레지?
회가 갈수록 내가 차차에 빙의되고 있어..ㅡㅡ;

사랑은 향기로 다가와~~ 꺅&gt;&lt;
오밤중에 이불킥하며 설레임에 어쩔바를 모르겠쟌느~~
그나저나 피자집사장과 김수경은 애초에 안맞는 커플이었네요 조용히 혼자 생각할 시간이 필요한 남자와 생각을 공유하거싶은 여자,,,, 내 마음을 인정해줬으면 좋겠는데.. 끝까지 남자입에선 그만가주라,, 는 말만 나오고... 애초에 성격이 너무 상극이네요.. 안타깝다
